import React from "react";
import "./PickList.css";

const Pick = ({ name }) => {
  console.log("Pick");
  return (
    <div className="element">
      <p>{name}</p>
      <div className="delete">x</div>
    </div>
  );
};

const PickList = ({ name, list }) => {
  console.log("PickList");
  return (
    <tr>
      <td></td>
      <td className={name}>
        {list && list.map((item) => <Pick name={item} />)}
      </td>
    </tr>
  );
};

export { Pick, PickList };
